    `},{title:"Couvert (D) / Cover",details:"<p>Les unit\xE9s adjacentes \xE0 ce d\xE9cor peuvent b\xE9n\xE9ficier d'un couvert lors d'une attaque \xE0 distance. La valeur D indique les d\xE9s ou symboles automatique que les unit\xE9s adjacentes ajoutent \xE0 leur jet de d\xE9fense.</p>"},{title:"Infranchissable / Impassable",details:"<p>Les unit\xE9s ne peuvent pas traverser ce d\xE9cor, n'y y finir leur mouvement. Si un d\xE9cor gagne la caract\xE9ristique Infranchissable pendant la bataille, les unit\xE9s qui s'y trouvent doivent se d\xE9placer pour devenir adjacentes.</p>"},{title:"Mortel (X:D) / Lethal",details:`
